import React from 'react';
import Tilt from 'react-tilt'
import talent from './talent3.jpg'
import './Logo.css'

const Logo = () => {
    return (
        <div className="ma4 mt0">
            <Tilt className="Tilt br2 shadow-5" options={{ max: 25 }} >
                <div className="Tilt-inner"><img src={talent} alt="logo"/></div>
            </Tilt>
        </div>
    )
}
export default Logo;
